import React, { Component } from 'react'

export default class AppHeader extends Component {
  constructor(props){
    super(props);
    this.state = {
      count: ''
    }
  }
  render() {
    return (
      <div>
        <h2>
          Todo List  
        </h2>
        <p>{this.state.count} more to do</p>
      </div>
    )
  }
}
